	<script type="text/javascript">
	(function()
	{
		var showError = function(xhr)
		{
			var responseObject = JSON.parse(xhr.response);
			
			errorMessage = xhr.statusText + "\n";
			for (var property in responseObject)
			{
				errorMessage += property + ": " + responseObject[property] + "\n";
			}
			
			document.getElementsByTagName('Body')[0].innerText = errorMessage
		}
		
		var generateDocs = function()
		{
			var xhr = new XMLHttpRequest();
			xhr.open("POST", "/dashboard/servlet/app-manager/apps/" + getAppName(), true);
			xhr.onload = function (e) {
			  if (xhr.readyState === 4) {
			    if (xhr.status === 200) {
			    	window.location = "/dashboard-services/appjsdoc/" + getAppName() + "/jsdoc-toolkit/index.html";
			    } else {
			    	showError(xhr);
			    }
			  }
			};
			xhr.onerror = function (e) {
				showError(xhr);
			};
			xhr.send("{command: 'generate-docs'}");
		};
		
		var getAppName = function()
		{
			var initialIndex = window.location.pathname.indexOf("jsdoc/") + 6;
			var lastIndex = window.location.pathname.indexOf("/jsdoc-toolkit");
			return window.location.pathname.substring(initialIndex, lastIndex);
		}
		
		if (window.addEventListener)
		{
			window.addEventListener("load", generateDocs, false);
		}
		else if (window.attachEvent)
		{
			window.attachEvent("onload", generateDocs);
		}
	}());
	</script>
